import React, { useEffect, useState } from "react";
import { makeStyles } from "@mui/styles";

const useountryStyles = makeStyles({
  country: {
    background: "#fff",
    width: "305px",
    boxShadow: "0px 3px 15px rgba(0,0,0,0.2)",
    borderRadius: 5,
    height: "370px",
    cursor: "pointer",
  },
  country_details: {
    padding: 15,
  },
});

const Country = () => {
  const [countries, setCountries] = useState<any>();
  const fetchData = async () => {
    const response = await fetch("https://restcountries.com/v3.1/all");
    const data = await response.json();
    setCountries(data);
  };

  useEffect(() => {
    try {
      fetchData();
    } catch (error) {
      console.log(error);
    }
  }, []);
  const Countryclasses = useountryStyles();
  return (
    <>
      {countries?.map((data: any) => {
        return (
          <>
            <div className={Countryclasses.country}>
              <img src="" />
            </div>
            <div className={Countryclasses.country_details}>
              <h3 className="name">Name</h3>
              <p>
                Population:<span className="values">Test</span>
              </p>
              <p>
                Region:
                <span className={Countryclasses.country_details}>Test</span>
              </p>
              <p>
                Capital:<span className="values">Test</span>
              </p>
            </div>
          </>
        );
      })}
    </>
  );
};

export default Country;
